def _cython_agg_blocks(
    self, how: str, alt=None, numeric_only: bool = True, min_count: int = -1
) -> "Tuple[List[Block], Index]":
    data: BlockManager = self._get_data_to_aggregate()

    if numeric_only:
        data = data._get_numeric_data()

    agg_blocks: List[Block] = []
    agg_items: List[Int64Index] = []

    for name, group in self:
        try:
            result = group._cython_operation(
                "aggregate", how, axis=1, min_count=min_count, numeric_only=numeric_only
            )
        except (NotImplementedError, DataError):
            try:
                result = group.aggregate(how)
            except TypeError as e:
                # Handle exceptions and perform an alternate aggregation
                result = group.aggregate(alt)

        # Convert safely to nullable integer dtype
        if is_any_int_dtype(result) and result.ndim == 1 and not is_extension_array_dtype(result):
            result = maybe_convert_objects(result)._mgr

        # Append the aggregated result to the list
        agg_blocks.append(make_block(result, group.items, group.blocks[0].ref_items, axis=0))
        agg_items.append(group.grouper.result_index)

    return agg_blocks, self._result_index
